INSERT INTO public.events VALUES ('e1000000-0000-0000-0000-000000000005', 'Celebração Cultural de Carnaval', 'Carnival Cultural Celebration', 'Kulturelle Karnevalsfeier', 'Kulturní oslava karnevalu', '<p>A Embaixada da República de Angola convida toda a comunidade berlinense para uma tarde de festa e alegria com a Celebração Cultural de Carnaval angolano. O Carnaval em Angola é uma das maiores expressões da cultura popular, com raízes profundas nas tradições dos diferentes povos que compõem a nação angolana. Berlim terá a oportunidade de viver esta experiência única de cores, ritmos e sabores.</p>
INSERT INTO public.events VALUES ('e1000000-0000-0000-0000-000000000003', 'Exposição de Arte Contemporânea Angolana', 'Exhibition of Contemporary Angolan Art', 'Ausstellung zeitgenössischer angolanischer Kunst', 'Výstava současného angolského umění', '<p>A Embaixada da República de Angola apresenta «Raízes e Horizontes» — uma exposição colectiva que reúne 15 artistas angolanos contemporâneos nas áreas da pintura, escultura, fotografia e instalação. A mostra explora a tensão criativa entre a herança cultural angolana e as linguagens artísticas globais, oferecendo ao público berlinense uma janela única sobre a vibrante cena artística de Luanda, Benguela e Huambo.</p>
INSERT INTO public.events VALUES ('e1000000-0000-0000-0000-000000000008', 'Recepção Diplomática de Primavera', 'Spring Diplomatic Reception', 'Diplomatischer Frühlingsempfang', 'Jarní diplomatický příjem', '<p>A Embaixada da República de Angola convida para a Recepção Diplomática de Primavera, um encontro que celebra a chegada da estação mais luminosa do ano nos jardins da residência do Embaixador. Esta recepção, que se tornou uma tradição apreciada pelo corpo diplomático de Berlim, oferece uma atmosfera única de convívio e diálogo num cenário de elegância natural.</p>
INSERT INTO public.events VALUES ('e1000000-0000-0000-0000-000000000010', 'Workshop de Língua Portuguesa para Diplomatas', 'Portuguese Language Workshop for Diplomats', 'Workshop Portugiesische Sprache für Diplomaten', 'Workshop portugalského jazyka pro diplomaty', '<p>A Embaixada da República de Angola, em parceria com o Instituto Camões e a Comunidade dos Países de Língua Portuguesa (CPLP), oferece um workshop intensivo de três dias de Língua Portuguesa especialmente concebido para diplomatas, funcionários de organizações internacionais e profissionais do sector empresarial alemão. A língua portuguesa é a 4.ª língua mais falada no mundo e uma das línguas oficiais das Nações Unidas, da União Africana e do Mercosul.</p>
INSERT INTO public.events VALUES ('e1000000-0000-0000-0000-000000000004', 'Conferência sobre Cooperação Económica Angola-Alemanha', 'Conference on Angola-Germany Economic Cooperation', 'Konferenz über die wirtschaftliche Zusammenarbeit Angola-Deutschland', 'Konference o hospodářské spolupráci Angola-Německo', '<p>A Embaixada da República de Angola, em parceria com a Câmara de Indústria e Comércio de Berlim (IHK Berlin) e a Câmara de Comércio e Indústria de Angola (CCIA), organiza a Conferência sobre Cooperação Económica Angola-Alemanha. Este fórum de dois dias visa aprofundar os laços económicos bilaterais e apresentar as oportunidades de investimento que Angola oferece aos parceiros europeus.</p>
INSERT INTO public.events VALUES ('e1000000-0000-0000-0000-000000000001', 'Dia da Independência de Angola', 'Angola Independence Day', 'Unabhängigkeitstag Angolas', 'Den nezávislosti Angoly', '<p>A Embaixada da República de Angola na Alemanha convida para a solene celebração do 50.º aniversário da Independência Nacional, proclamada a 11 de Novembro de 1975 pelo Presidente António Agostinho Neto. Esta data marca um momento decisivo na história do povo angolano e na afirmação da soberania nacional.</p>
INSERT INTO public.events VALUES ('e1000000-0000-0000-0000-000000000002', 'Recepção de Ano Novo do Corpo Diplomático', 'New Year Reception for the Diplomatic Corps', 'Neujahrsempfang des Diplomatischen Korps', 'Novoroční recepce diplomatického sboru', '<p>A Embaixada da República de Angola tem a honra de convidar o distinto Corpo Diplomático acreditado em Berlim para a tradicional Recepção de Ano Novo. Este encontro anual constitui uma oportunidade privilegiada para renovar os votos de paz, prosperidade e cooperação internacional no início de um novo ano.</p>
INSERT INTO public.events VALUES ('e1000000-0000-0000-0000-000000000006', 'Seminário sobre Investimento em Angola', 'Seminar on Investment in Angola', 'Seminar über Investitionen in Angola', 'Seminář o investicích v Angole', '<p>A Embaixada da República de Angola e a Agência de Investimento Privado e Promoção das Exportações de Angola (AIPEX) organizam um seminário intensivo dirigido a empresários, investidores e profissionais alemães interessados no mercado angolano. Angola vive um momento de diversificação económica acelerada, com reformas estruturais que tornaram o ambiente de negócios mais competitivo e transparente.</p>
INSERT INTO public.events VALUES ('e1000000-0000-0000-0000-000000000007', 'Festival de Cinema Angolano em Berlim', 'Angolan Film Festival in Berlin', 'Angolanisches Filmfestival in Berlin', 'Festival angolského filmu v Berlíně', '<p>A Embaixada da República de Angola apresenta a 1.ª edição do Festival de Cinema Angolano em Berlim, uma mostra de três dias que reúne o melhor da produção cinematográfica angolana contemporânea. Realizado no prestigiado Arsenal — Institut für Film und Videokunst, o festival oferece uma janela privilegiada sobre a criatividade, as histórias e as vozes de Angola através da sétima arte.</p>
INSERT INTO public.events VALUES ('e1000000-0000-0000-0000-000000000009', 'Dia de África', 'Africa Day', 'Tag Afrikas', 'Den Afriky', '<p>A Embaixada da República de Angola, em colaboração com as embaixadas africanas acreditadas em Berlim, organiza a celebração do Dia de África — data que assinala a fundação da Organização da Unidade Africana (hoje União Africana) a 25 de Maio de 1963. Este evento pan-africano é uma celebração da diversidade cultural, da unidade e das aspirações partilhadas do continente africano.</p>
